import "./front.css";

const Front = () => {
    return (
       <>
       <div className="header">
           <h3>NFT Marketplace</h3>
        
       </div>
       <div className="footer">
        <p>Developed By Fraz Naveed</p>
       </div>
       </>
    )
}
export default Front
